import React from 'react'

export default function SimpleModal(props) {
  return (
    <div>
      <Modal
        title="Confirm"
        visible={props.visible}
        onOk={()=>props.onOk}
        onCancel={() => props.OnCancel(false)}
        okText="Confirm"
        cancelText="Cancel"
      >
       <props.modalString />
      </Modal>
    </div>
  )
}
